import React, {Component} from 'react';
import {Link} from 'react-router-dom';
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';
import Button from 'react-bootstrap/Button';
import './home.scss';

class register extends Component {
    render() {
        return (
            <Form>
                <Form.Group controlId="EmailInput">
                    <Form.Label>Email</Form.Label>
                    <Form.Control type="email" placeholder="Enter your Email ID" />
                </Form.Group>
                <Form.Group controlId="PwdInput">
                    <InputGroup>
                        <InputGroup.Prepend>
                            <InputGroup.Text><i className="fa fa-lock"></i></InputGroup.Text>
                        </InputGroup.Prepend>
                        <Form.Control type="password" placeholder="Enter your Password" aria-describedby="inputGroupPrepend" required />
                        <Form.Control.Feedback type="invalid">Please enter your password.</Form.Control.Feedback>
                    </InputGroup>
                </Form.Group>
                <Button variant="primary" type="submit">
                    Submit
                </Button>
                <Link to="/">Already have an account? So, login</Link>
            </Form>
        )
    }
}

export default register;
